import React, {useState} from "react"
import CUButton from "../../components/CUButton/CUButton"
import Dialog from "../../components/Dialog/Dialog"

const Home = () => {
    const [isOpen, setIsOpen] = useState(false)

    const handleClick = () =>{
        setIsOpen(true)
        return <Dialog open={isOpen} title="Hola" ></Dialog>
    }
    return <CUButton onClick={handleClick}></CUButton>
 
}



export default Home
